import React, {Component} from 'react';
import Binario from "./Binario";
import Altro from "./Altro";
import {Link} from 'react-router-dom';
import Home from "./Home";
class Nav extends Component {
    render() {
        return (
            <div className='nav'>
                <Link to='/binario'>
                  <Binario/>
                </Link>
                
                <Link to='/Altro'>
                <Altro/>
                </Link>

                <Link to='/Home'>
                    <Home/>
                </Link>
                </div>
        );
    }
}

export default Nav;
